import React from "react";
import { Link } from "react-router-dom";

export default function Navbar({ user }) {
  return (
    <div className="navbar flex items-center justify-between p-4 bg-gray-800 text-white">
      <span className="logo text-xl font-bold">
        <Link className="link text-white hover:text-gray-300" to="/">
          Rajan Shop
        </Link>
      </span>
      {user ? (
        <ul className="list flex items-center gap-4">
          <li className="listItem">
            <img
              className="avatar w-10 h-10 rounded-full"
              src={user.avatar || "https://via.placeholder.com/40"}
              alt={`${user.name}'s Avatar`}
            />
          </li>
          <li className="listItem font-semibold">{user.name || "User"}</li>
          <li className="listItem">
            <button className="bg-red-500 px-3 py-1 rounded hover:bg-red-600">
              Logout
            </button>
          </li>
        </ul>
      ) : (
        <Link
          className="link bg-blue-500 px-3 py-1 rounded hover:bg-blue-600"
          to="/login"
        >
          Login
        </Link>
      )}
    </div>
  );
}
